import{f as e,g as l,J as i}from"./common-03e46d7f.js";const t='{"title":"如何通过浏览器调试H5移动端样式","frontmatter":{"date":"2022-08-18","title":"如何通过浏览器调试H5移动端样式","tags":["mobile"],"describe":"通过chrome或edge浏览器来调试手机端样式"},"relativePath":"docs/mobile/mobileDebugging.md","lastUpdated":1742205571299.0388}';var o={};const s=[i('<p>最近在弄邮件编辑器业务，通过HTML发送邮件，发现在移动端展示样式会出问题，一开始并不知道该怎么调试，于是各种百度，将我的方法总结一下：<br></p><p>分两种情况：</p><ul><li><p>没有翻墙环境：使用edge</p><ol><li>安卓手机开启开发者模式，打开USB调试</li><li>连接电脑</li><li>打开edge浏览器，输入<code>edge://inspect/#devices</code></li><li>等待手机和edge响应，选择是否允许USB调试，会出现一下界面，则说明链接成功 <img src="/blog/_assets/insper.cd81f4dc.jpg" alt="inspect"></li><li>点击<code>inspect</code>，会出现这个界面，就可以像pc端一样调试了 <img src="/blog/_assets/result.0e437255.jpg" alt="result"> edge是真的强大，不用翻墙所有chrome浏览器的功能基本都能实现</li></ol></li><li><p>有翻墙环境：使用chrome 和edge同样的操作，不过需要有vpn才行，不然就会一致404 Not Found</p></li></ul>',3)];o.render=function(i,t,o,d,c,r){return e(),l("div",null,s)};export{t as __pageData,o as default};
